import React from 'react';
import PlusIcon from '@assets/svg/menu-svg/Plus.svg';

const index = () => {
    return (
        <div className="flex justify-center">
            <div className=" bottom-3 fixed">
                <div className="border-4 border-white h-14 w-auto bg-green-600 rounded-full flex justify-center items-center">
                    <div className="flex  text-white text-sm px-5">
                        <PlusIcon fill="white" className="ml-5" />
                        <p>افزودن آگهی</p>
                    </div>
                </div>
            </div>
        </div>
    );
};

export default index;
